  componentDidMount(){
      //fetch calendar data
      fetch(this.url)
      .then((data) => data.json())
      .then((data) => this.setState({'Aug 14 2021': data['Aug 14 2021']}))
      // .catch((error) => console.log(error))
      // .then(setTimeout(() => console.log(this.calData), 1000))
  }

  render() {
    return (
      <div>
        <h1>Calendar</h1>
        <div className="Day"> {this.data} </div>
      </div>
    );
  }
}

